<?php
// This script returns a JSON dataset of up to 1396 records in 14 columns
// "extid","name","date","price","number","address","company","desc","age","title","phone","email","zip","country"

header('Content-type: application/json');

// Define defaults
$results = -1; // default get all
$start = 0; // default start at 0
$sort = null; // default don't sort
$dir = 'asc'; // default sort dir is asc

// How many records to get?
if(strlen($_GET['results']) > 0) {
    $results = $_GET['results'];
}

// Start at which record?
if(strlen($_GET['start']) > 0) {
    $start = $_GET['start'];
}

// Sorted?
if(strlen($_GET['sort']) > 0) {
    $sort = $_GET['sort'];
}

// Sort dir?
if((strlen($_GET['dir']) > 0) && ($_GET['dir'] == 'desc')) {
    $dir = $_GET['dir'];//SORT_DESC;
}

// Return the data
returnData($results, $start, $sort, $dir);

function returnData($results, $start, $sort, $dir) {
    // All records
    $allRecords = initArray();

    // Need to sort records
    if(!is_null($sort)) {

        // Obtain a list of columns
        foreach ($allRecords as $key => $row) {
            $sorted[$key] = $row[$sort];
        }

        // Valid sort value
        if(count($sorted) > 0) {
            // Sort the original data
            // Add $allRecords as the last parameter, to sort by the common key
            array_multisort($sorted, $dir, $allRecords);
        }
    }

    // Invalid start value
    if(is_null($start) || !is_numeric($start) || ($start < 0)) {
        // Default is zero
        $start = 0;
    }
    // Valid start value
    else {
        // Convert to number
        $start += 0;
    }

    // Invalid results value
    if(is_null($results) || !is_numeric($results) ||
            ($results < 1) || ($results >= count($allRecords))) {
        // Default is all
        $data = $allRecords;
    }
    // Valid results value
    else {
        // Convert to number
        $results += 0;


        // Iterate through records and return from start index
        for($i=$start; $i<($start+$results); $i++) {
            $data[] = $allRecords[$i];
        }
    }

    // Create return value
    $returnValue = array(
        'recordsReturned'=>$results,
        'totalRecords'=>count($allRecords),
        'startIndex'=>$start,
        'sort'=>$sort,
        'dir'=>$dir,
        'records'=>$data
    );

    // JSONify
    //print json_encode($returnValue);

    // Use Services_JSON
    require_once('JSON.php');
    $json = new Services_JSON();
    print ($json->encode($returnValue)); // Instead of json_encode
}

